import React from "react";
import { styled } from "styled-components";
import { ReactComponent as HeaderImg } from "../images/mypage.svg";
import { ReactComponent as ProfileImg } from "../images/profile.svg";
import Footer from "../components/Footer";
import Slider from "react-slick";

export default function MatchingProfile() {
  const userData = [
    {
      name: "AlmondBriize",
      sex: "여성",
      age: 23,
      location: "합정역 2호선",
    },
  ];
  function SampleNextArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "red" }}
        onClick={onClick}
      />
    );
  }

  function SamplePrevArrow(props) {
    const { className, style, onClick } = props;
    return (
      <div
        className={className}
        style={{ ...style, display: "block", background: "green" }}
        onClick={onClick}
      />
    );
  }

  var settings = {
    dots: false,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
  };

  return (
    <div>
      <HeaderImg />
      <ProfileBox>
        <ProfileImg />
        <UserName>AlmondBriize(여성/23)</UserName>
        <UserLocation>합정역 2호선</UserLocation>
      </ProfileBox>
      <PostBox>
        <h2>작성한 글</h2>
        <Slider {...settings}>
          <ReviewBox>1</ReviewBox>
          <ReviewBox>2</ReviewBox>
          <ReviewBox>3</ReviewBox>
        </Slider>
      </PostBox>
      <ReviewBox></ReviewBox>
      <Footer />
    </div>
  );
}

const ProfileBox = styled.div`
  text-align: center;
  margin-top: 72px;
`;

const UserName = styled.div`
  color: var(--Black, #222);
  font-family: Pretendard;
  font-size: 36px;
  font-style: normal;
  font-weight: 600;
  line-height: 140%; /* 50.4px */
  letter-spacing: -1px;
`;

const UserLocation = styled.div`
  color: var(--Gray-02, #ccc);
  font-family: Pretendard;
  font-size: 20px;
  font-style: normal;
  font-weight: 600;
  line-height: 140%; /* 28px */
  letter-spacing: -1px;
`;

const PostBox = styled.div``;

const ReviewBox = styled.div``;
